import React from 'react';

let heading = "Welcome to House Plant"
let subheading = "A interactive website that helps you become a better plant owner"

function Home() {
  return (
    <div className='home'>
      <section className="hero">
        <div className="hero-body">
          <h1 className="title">{heading}</h1>
          <div className="is-two-thirds column is-paddingless">
            <h3 className="subtitle is-4">{subheading}</h3>
          </div>
          <a className="button is-large is-primary" id="learn">Learn More</a>
        </div>
      </section>
      <h1>Home</h1>
    </div>
  );
}

export default Home;
